    "library(tidyverse)\n",
    "\n",
    "library(caret)#ML \n",
    "\n",
    "library(tiff)#Image processing package.\n",
    "\n",
    "library(raster)#Image visualisation / processing package.\n",
    "\n",
    "#Visualise a sample Tiff in train data.set\n",
    "\n",
    "train_file_list <- list.files(\"../input/mayo-clinic-strip-ai/train\")\n",
    "\n",
    "sample <- as.character(sample(train_file_list,size = 1))\n",
    "\n",
    "sample_path <- paste(\"../input/mayo-clinic-strip-ai/train/\",sample, sep = \"\")\n",
    "\n",
    "rgb <- brick(sample_path)\n",
    "\n",
    "plot(rgb)\n",
    "\n",
    "grey <- raster(sample_path)\n",
    "\n",
    "plot(grey)\n",
    "\n",
    "#Pushes will push the CPU..."
